import React , {Component} from 'react'
import Child from './Child'
import Items from './Items'

class App extends Component{
    state = {
        List :[
            {id:1, name :'sayed', age : 21},
            {id:2, name :'Ahmed', age : 10}
        ]
    }
    render(){
        return(
            <div>
                <Items data={this.state.List}/>
            </div>
        );
    }
}

export default App
